import { useRouter } from 'next/router'
import Link from 'next/link'

const Post = () => {
  const router = useRouter()
  const { id } = router.query

  return (
    <div style={{
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      padding: "4rem",
    }}>
      <p>Doc: {id}</p>
      <Link href="/">home</Link>
    </div>
  )
}

export default Post
